import styled from 'styled-components';

export const Container = styled.div`
  height: 100vh;
  width: 100%;
  padding: 0;
  margin: 0;
  background-color: blue;
`;

export const MainBlock = styled.main`
  height: calc(100vh - 150px);
  display: flex;
  background-color: red;
`;
